import React from 'react';

export default function RouteList({ routes }) {
  return (
    <div className="route-list">
      {routes.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Откуда</th>
              <th>Куда</th>
              <th>Дата</th>
              <th>Цена</th>
            </tr>
          </thead>
          <tbody>
            {routes.map((route) => (
              <tr key={route._id}>
                <td>{route.from}</td>
                <td>{route.to}</td>
                <td>{new Date(route.date).toLocaleDateString()}</td>
                <td>{route.price} ₽</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>Нет доступных маршрутов</p>
      )}
    </div>
  );
}
